import NuevoProyecto from './NuevoProyecto'
import Row from 'react-bootstrap/Row'
import './Sidebar.css'

const Sidebar = () => {
    return (
        <Row className='barraLateral h-100 m-0'>
            <p className='tituloBarraLateral mt-5'><strong>MERN</strong>task</p>
            <NuevoProyecto></NuevoProyecto>
            <p className='tituloProyectos mt-5'>Tus Proyectos</p>
        </Row>
    );
}
 
export default Sidebar;
